import React from 'react';
import ReactDOM from 'react-dom';
import './App.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {addMenu} from "./data/state";

export const rerenderTree = (state) => {
  ReactDOM.render(<App state={state} addMenu={addMenu} updateMenu />, document.getElementById('root'));
}



serviceWorker.unregister();
